        <p>Feel free to contact me via any of the channels below:</p>

            <ol>
            <a href="https://www.linkedin.com/in/japheth-habinshuti-n-430a54100/">LinkedIn</a>.
            <a href="http://forum.kirupa.com">Twitter</a>.
            <a href="https://www.facebook.com/habinshutin.japheth">Facebook</a>.
            </ol>
           
        
      </div>
    );
  }
}
 
export default Contact;
